import React from "react";

const Table = ({
  assignment,
  grade,
  weight,
  onAssignmentChange,
  onGradeChange,
  onWeightChange,
}) => {
  return (
    <tr>
      <td>
        <input
          type="text"
          value={assignment}
          onChange={onAssignmentChange}
          placeholder="e.g Homework"
        />
      </td>
      <td>
        <input
          className="gradeInput"
          type="number"
          value={grade}
          onChange={onGradeChange}
        />
      </td>
      <td>
        <input
          className="weightInput"
          type="number"
          value={weight}
          onChange={onWeightChange}
        />
      </td>
    </tr>
  );
};

export default Table;
